import "./about.scss";

export default function Works() {
  return (
    <div className="about" id="about">
      <div className="left">
        <div className="wrapper">
          <h1>Sobre Mí</h1>
          <span>Hola, mi nombre es Darwin Rogel, desarrollador de software. En la actualidad resido en Ecuador, principalmente me enfoco en trabajar con tecnologías del lado del Backend y Frontend. Además, debo mencionar que he realizado proyectos en el ámbito de infraestructura tecnológica.</span>
          <span>Me considero una persona autodidacta y constantemente me gusta adquirir nuevos conocimientos, en mi tiempo libre disfruto de la lectura, escuchar música y realizar investigación.</span>
        </div>
      </div>
      <div className="right">
        <div className="imgContainer">
          <img src="assets/persona.png" />
        </div>
      </div>
    </div>
  );
}
